frame_eqs_eel:
warp = 0;

tic = min(time-tin,.1);
tin = time;

vol = (bass_att + treb_att + mid_att)*.333333;

ra = 1/tic*.25;

vav = tic*(vav*(1/tic - ra) + ra*(bass+treb+mid)*.33333);

ra = 1/tic*.05;
treb_avg = tic*(treb_avg*(1/tic - ra) + ra*treb);
mid_avg = tic*(mid_avg*(1/tic - ra) + ra*mid);

ra = 1/tic*.1;
bass_avg = tic*(bass_avg*(1/tic - ra) + ra*bass);


tt = tt + tic*treb;
mt = mt + tic*mid;
bt = bt + tic*bass;
vt = vt + tic*vav;

q1 = time;

q2 = vav*.1;

q3 = .1 + bass_avg*.05; // size and spacing

q4 = .5 + (treb_avg + mid_avg)*.25;
